version: '3.8'

# Yaml defaults
x-deploy-worker: &DEPLOY_WORKER
  mode: replicated
  replicas: 1
  update_config:
    parallelism: 1
    delay: 10s
    failure_action: rollback
    monitor: 30s
    order: start-first

  placement:
    constraints:
      - node.role == worker

x-hosts: &HOSTS
  - "example1:1.1.1.1"
  - "example2:2.2.2.2"

x-environment: &ENVIRONMENT
  HTTP_PROXY:  http://proxy:3128
  HTTPS_PROXY: http://proxy:3128

x-command: &COMMAND
  - tail
  - -f
  - /dev/null

